import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "status-critical";
const pathData = "M8.125 387l192-354c24-45 88-45 112 0l192 354c23 42-8 94-56 94h-384c-48 0-79-52-56-94zm216-106c0 18 14 33 32 33s32-15 32-33V153c0-17-14-32-32-32s-32 15-32 32v128zm70 110c0-21-17-38-38-38s-38 17-38 38c0 22 17 39 38 39s38-17 38-39z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
